	/**
	 * 推送直邮订单
	 * @param directOrderDto
	 * @return
	 */
	@Override
	public RetMessageNBDto pushDirectOrderNB(SubOrder subOrder,List<ItemSku> itemSkuList){
		if(null == subOrder){
			LOG.error("===================订单为空====================");
			return null;
		}
		List<OrderItem> orderItemList =  getOrderItemList(subOrder);
		OrderConsignee orderConsignee = getOrderConsignee(subOrder);
		DirectOrderNBDto directOrderDto = parseDirectOrder(subOrder,orderItemList,orderConsignee,itemSkuList);
		
		String xmlStr = toXML(directOrderDto);
		LOG.info("推送直邮接口入参XML："+xmlStr);
		String signStr = sign(USERCODE,PASSWORD,xmlStr,SECRET);
		Map<String,String> params = new HashMap<String,String>();
		params.put("user_code", USERCODE);
		params.put("password", PASSWORD);
		params.put("sign", signStr);
		params.put("xml", xmlStr);
		String result = null;
		DerictOperatLog derictOperatLog = null;
		try {
			result = HttpClientUtil.postData(createOrderUrl, params, "UTF-8");
			derictOperatLog = addLog(directOrderDto.getSaleOrderCode(),result,PUSH_DIRECT_ORDER);//新增日志表记录
//			addLog(directOrderDto.getSaleOrderCode(),result,PUSH_DIRECT_ORDER);//新增日志表记录
			
			LOG.info("推送直邮接口返回结果："+result);
			System.out.println("返回结果："+result);
		} catch (Exception e) {
			LOG.error(e.getMessage());
		}
		RetMessageNBDto retMessage = xmlToObject(result); 
		updateLog(derictOperatLog.getId(),directOrderDto.getSaleOrderCode(),retMessage,PUSH_DIRECT_ORDER);//新增日志表记录
		return retMessage;
	}
	
