	/**
	 * 拼参数
	 */
	private DirectOrderNBDto parseDirectOrder(SubOrder subOrder,List<OrderItem> orderItemList,OrderConsignee orderConsignee,List<ItemSku> itemSkuList){
		
		DirectOrderNBDto directOrderDto = new DirectOrderNBDto();
		DirectOrderDetailNBDto directOrderDetailDto = new DirectOrderDetailNBDto();
		List<DirectOrderDetailNBDto> details = new ArrayList<DirectOrderDetailNBDto>();
		
		/**=======================================directOrderDto对象内容 ===========================================*/
		directOrderDto.setAddress(orderConsignee.getAddress()==null?"":orderConsignee.getAddress());
		directOrderDto.setBuyerName(subOrder.getAccountName()==null?"":subOrder.getAccountName());
		directOrderDto.setBuyerNickName(subOrder.getAccountName()==null?"":subOrder.getAccountName());
		directOrderDto.setBuyerAccount(subOrder.getAccountName()==null?"":subOrder.getAccountName());
		directOrderDto.setBuyerPayment(String.valueOf(subOrder.getTotal())==null?"":String.valueOf(subOrder.getTotal()));
		directOrderDto.setBuyerRemark(subOrder.getRemark()==null?"":subOrder.getRemark());
		directOrderDto.setCity(orderConsignee.getCityName()==null?"":orderConsignee.getCityName());
		directOrderDto.setCreateTime(DateUtil.format(subOrder.getCreateTime(),DateUtil.NEW_FORMAT)==null?"":DateUtil.format(subOrder.getCreateTime(),DateUtil.NEW_FORMAT));
		directOrderDto.setDistrict(orderConsignee.getCountyName()==null?"":orderConsignee.getCountyName());
		directOrderDto.setIdCard(orderConsignee.getIdentityCard()==null?"":orderConsignee.getIdentityCard());
		directOrderDto.setPayTime(DateUtil.format(subOrder.getPayTime(),DateUtil.NEW_FORMAT)==null?"":DateUtil.format(subOrder.getPayTime(),DateUtil.NEW_FORMAT));
		directOrderDto.setProvince(orderConsignee.getProvinceName()==null?"":orderConsignee.getProvinceName());
		directOrderDto.setReceiverName(subOrder.getConsigneeName()==null?"":subOrder.getConsigneeName());
		directOrderDto.setReceiverPhone(subOrder.getConsigneeMobile()==null?"":subOrder.getConsigneeMobile());
		directOrderDto.setSaleOrderCode(String.valueOf(subOrder.getOrderCode())==null?"":String.valueOf(subOrder.getOrderCode()));
		directOrderDto.setSellerRemark("");
		directOrderDto.setZipCode(orderConsignee.getPostcode()==null?"":orderConsignee.getPostcode());
		/**=======================================directOrderDto对象内容 end ===========================================*/
		for(OrderItem item:orderItemList){
			/**=======================================directOrderDetailDto对象内容  ===========================================*/
			directOrderDetailDto.setProductNumberCode(item.getSkuCode()==null?"":item.getSkuCode());
			directOrderDetailDto.setSaleGoodsName(item.getSpuName()==null?"":item.getSpuName());
			directOrderDetailDto.setSaleGoodsPrice(String.valueOf(item.getSalesPrice())==null?"":String.valueOf(item.getSalesPrice()));//单价
			directOrderDetailDto.setSaleNumber(String.valueOf(item.getQuantity())==null?"":String.valueOf(item.getQuantity()));
			directOrderDetailDto.setSaleSubTotal(String.valueOf(item.getSubTotal())==null?"":String.valueOf(item.getSubTotal()));//金额
			for(ItemSku itemSku:itemSkuList){
				if(itemSku.getSku().equals(item.getSkuCode())){
					Map<String,Object> params = new HashMap<String,Object>();
					params.put("sku", itemSku.getSku());
					List<ItemSkuArt> itemSkuArts = itemSkuArtService.queryByParam(params);
					if(null!=itemSkuArts&&itemSkuArts.size()>0){
						directOrderDetailDto.setHsCode(itemSkuArts.get(0).getHsCode());
					}
					directOrderDetailDto.setSkuCode(itemSku.getGoodsCode());
				}
			}
			/**=======================================directOrderDetailDto对象内容end  ===========================================*/
			details.add(directOrderDetailDto);
		}
		directOrderDto.setDetails(details);
		return directOrderDto;
	}

	/**获取联系人信息*/
	private OrderConsignee getOrderConsignee(SubOrder subOrder){
		if(null == subOrder.getParentOrderCode() || "".equals(subOrder.getParentOrderCode())){
			LOG.error("===================订单没有父订单号！=====================");
			return null;
		}
		Map<String,Object> params = new HashMap<String,Object>();
		params.put("parent_order_code", subOrder.getParentOrderCode());
		List<OrderConsignee> orderConsigneeList = orderConsigneeService.queryByParam(params);
		if(null == orderConsigneeList || orderConsigneeList.size()<=0){
			LOG.error("=====================联系人信息为空！====================");
			return null;
		}
		return orderConsigneeList.get(0);
	}
	/**获取订单中的商品信息 */
	private List<OrderItem> getOrderItemList(SubOrder subOrder){
		if(null == subOrder.getOrderCode() || "".equals(subOrder.getOrderCode())){
			LOG.error("===================订单没有订单号！=====================");
			return null;
		}
		Map<String,Object> params = new HashMap<String,Object>();
		params.put("order_code", subOrder.getOrderCode());
		List<OrderItem> itemList = orderItemService.queryByParam(params);
		if(null == itemList || itemList.size()<=0){
			LOG.error("=====================没有对应订单的商品！====================");
			return null;
		}
		return itemList;
	}
	
	
