	/**
	 * 获取库存信息
	 * @param 
	 * @return
	 */
	@Override
	public RetMessageNBDto getProductStoreNB(List<String> productNumberCodes) {
		StringBuffer xmlStrBf = new StringBuffer();
		xmlStrBf.append("<Message>");
		xmlStrBf.append("<Body>");
		xmlStrBf.append("<Products>");
		for(String productNumberCode: productNumberCodes){
			xmlStrBf.append("<Product>");
			xmlStrBf.append("<ProductNumberCode>");
			xmlStrBf.append(productNumberCode);
			xmlStrBf.append("</ProductNumberCode>");
			xmlStrBf.append("</Product>");
		}
		xmlStrBf.append("</Products>");
		xmlStrBf.append("</Body>");
		xmlStrBf.append("</Message>");
		String xmlStr = xmlStrBf.toString();
		LOG.info("获取商品信息接口入参XML："+xmlStr);
		String signStr = sign(USERCODE,PASSWORD,xmlStr,SECRET);
//		String signStr = sign("seagoor","vW6D4NrHb^S3",xmlStr,"1710");
		Map<String,String> params = new HashMap<String,String>();
		params.put("user_code", USERCODE);
		params.put("password", PASSWORD);
//		params.put("user_code", "seagoor");
//		params.put("password", "vW6D4NrHb^S3");
		params.put("sign", signStr);
		params.put("xml", xmlStr);
		String result = null;
		try {
			result = HttpClientUtil.postData(getProductStoreUrl, params, "UTF-8");
//			result = HttpClientUtil.postData("http://genertec.perninae.com/index.php/API/Product/getProductStore.html", params, "UTF-8");
			addLog("0", result, GET_PRODUCT_STORE);
			LOG.info("获取商品信息返回结果："+result);
			System.out.println("返回结果："+result);
		} catch (Exception e) {
			LOG.error(e.getMessage());
		}
		return xmlToObject(result);
	}
