	/**
	 * 对象转XML
	 */
	private String toXML(DirectOrderNBDto directOrderDto){
		RequstNBDto requstDto = new RequstNBDto();
		requstDto.setBody(directOrderDto);
		XStream xstream = new XStream();  
		xstream.alias("Message", RequstNBDto.class);  
        xstream.alias("Detail", DirectOrderDetailNBDto.class);  
		return xstream.toXML(requstDto);  
	}
	
	/**
	 * 拼接请求xml
	 */
	private String parseXML(String saleOrderCode){
		StringBuffer xmlSbf = new StringBuffer();
		xmlSbf.append("<Message>");
		xmlSbf.append("<Body>");
		xmlSbf.append("<SaleOrderCode>");
		xmlSbf.append(saleOrderCode);
		xmlSbf.append("</SaleOrderCode>");
		xmlSbf.append("</Body>");
		xmlSbf.append("</Message>");
		return xmlSbf.toString();
	}
	
	
	//过滤含bom的utf-8编码字符串
	private String filterEncodingBomForXml(String xml){
		if (null != xml && !"".equals(xml)) {
			if (xml.indexOf("<") != -1 && xml.lastIndexOf(">") != -1 && xml.lastIndexOf(">") > xml.indexOf("<"))
				xml = xml.substring(xml.indexOf("<"), xml.lastIndexOf(">") + 1);
		}
		return xml;
	}
	
