	/**
	 * 解析xml字符串
	 */
	public RetMessageNBDto xmlToObject(String xml){
		RetMessageNBDto retMessageDto = new RetMessageNBDto();
		List<ProductNBDto> products = new ArrayList<ProductNBDto>();
	    Document doc = null;  
	    try {  
	    	// 将字符串转为XML 
	    	InputSource in = new InputSource(new StringReader(filterEncodingBomForXml(xml))); 
	        in.setEncoding("UTF-8");  
	        SAXReader reader = new SAXReader();  
	        doc = reader.read(in);  
	    	// 获取根节点  
	    	Element rootElt = doc.getRootElement();   
//	    	// 拿到根节点的名称  
//	    	System.out.println("根节点：" + rootElt.getName());   
	          // 获取根节点下的子节点的值
	          String result = rootElt.elementTextTrim("Result"); 
	          String resultMsg = rootElt.elementTextTrim("ResultMsg"); 
	          String orderStatus = rootElt.elementTextTrim("OrderStatus"); 
	          String logistics = rootElt.elementTextTrim("Logistics"); 
	          String logisticsNumber = rootElt.elementTextTrim("LogisticsNumber"); 
	          retMessageDto.setLogistics(logistics);
	          retMessageDto.setLogisticsNumber(logisticsNumber);
	          retMessageDto.setOrderStatus(orderStatus);
	          retMessageDto.setResult(result);
	          retMessageDto.setResultMsg(resultMsg);
	          
	          // 获取根节点下的子节点Products  
	          Iterator iterProducts = rootElt.elementIterator("Products");   
	          // 遍历Products节点  
	          while (iterProducts.hasNext()) {  
	              Element recordEle = (Element) iterProducts.next();  
	              // 获取子节点Products下的子节点Product  
	              Iterator itersProduct = recordEle.elementIterator("Product");   
	              // 遍历Product节点下的节点  
	              while (itersProduct.hasNext()) {  
	            	  ProductNBDto productDto = new ProductNBDto();
	                  Element itemEle = (Element) itersProduct.next();  
	                  // 拿到Product下的子节点的字节点的值  
	                  String productNumberCode = itemEle.elementTextTrim("ProductNumberCode");   
	                  String productBarCode = itemEle.elementTextTrim("ProductBarCode");  
	                  String productName = itemEle.elementTextTrim("ProductName");  
	                  String storeNumber = itemEle.elementTextTrim("StoreNumber")==null||itemEle.elementTextTrim("StoreNumber").equals("")?"0":String.valueOf(itemEle.elementTextTrim("StoreNumber")); 
	                  float storeNumberNew = Float.valueOf(storeNumber);
	                  productDto.setProductBarCode(productBarCode);
	                  productDto.setProductName(productName);
	                  productDto.setProductNumberCode(productNumberCode);
	                  productDto.setStoreNumber((int)storeNumberNew);
	                  products.add(productDto);
	              }  
	          }
	          retMessageDto.setProducts(products);
	      } catch (DocumentException e) {  
	          e.printStackTrace();  
	      } catch (Exception e) {  
	          e.printStackTrace();  
	      } 
		return retMessageDto;
	}

	/**
	 * 新增日志表记录
	 */
	private DerictOperatLog addLog(String orderCode,String result,Integer operatType){
		DerictOperatLog derictOperatLog = new DerictOperatLog();
		derictOperatLog.setOrderCode(Long.parseLong(orderCode));//订单编号
		derictOperatLog.setOperatType(operatType);
		derictOperatLog.setCreateTime(new Date());
		derictOperatLog.setCreateUser("system");
		derictOperatLog.setOriginalResult(result);//接口返回的原始数据
		derictOperatLog.setModifyTime(new Date());
		derictOperatLog.setModifyUser("system");
		return derictOperatLogService.insert(derictOperatLog);
	}
	/**
	 * 新增日志表记录
	 */
	private void updateLog(Long id,String orderCode,RetMessageNBDto retMessage,Integer operatType){
		DerictOperatLog derictOperatLog = derictOperatLogService.queryById(id);
		if("T".equals(retMessage.getResult())){
			derictOperatLog.setIsSuccess(RETURN_TRUE);
			derictOperatLog.setOperatMessage(retMessage.getResultMsg()==null?"":retMessage.getResultMsg());
		}else{
			derictOperatLog.setIsSuccess(RETURN_FALSE);
			derictOperatLog.setOperatMessage(retMessage.getResultMsg()==null?"":retMessage.getResultMsg());
		}
		derictOperatLog.setModifyTime(new Date());
		derictOperatLog.setModifyUser("system");
		derictOperatLogService.updateById(derictOperatLog);
	}
	

